import React from "react";
import {Link} from "react-router-dom";

function ContactMe() {
    return(
        <>
        
        <main>
            <h2> This is the Contact Me page</h2>
        </main>
        
        <nav>
            <Link to ="/"> Home </Link>
        </nav>

        <nav>
            <Link to ="about"> About </Link>
        </nav>

        <nav>
          <Link to ="projects"> Projects </Link>
        </nav>

        </>

    );
}

export default ContactMe
